export enum LineCap {
  butt = 'butt',
  square = 'square',
  round = 'round'
}

export enum LineJoin {
  bevel = 'bevel',
  round = 'round',
  miter = 'miter'
}

export enum Pattern {
  repeat = 'repeat',
  repeat_x = 'repeat-x',
  repeat_y = 'repeat-y',
  no_repeat = 'no-repeat'
}

export enum weights {
  lighter = 'lighter',
  normal = 'normal',
  bolder = 'bolder',
  bold = 'bold'
}
